import pkg_resources
for d in pkg_resources.working_set:
     if str(d)[0:3] == "ff3" or str(d)[0:12] == "pycryptodome":
          print(str(d))

from ff3 import FF3Cipher
import string

key = "2DE79D232DF5585D68CE47882AE256D6"
tweak = "CBD09280979564"

def fpe_ff3_base(col_val, radix):

    c = FF3Cipher(key, tweak, radix=radix)
    ciphertext = c.encrypt(col_val)
    return ciphertext

def fpe_ff3_numeric(col_val):

    ciphertext =""
    if len(col_val) < 6:
        col_val = str(col_val).rjust(6, '0')
        ciphertext = fpe_ff3_base(col_val, 10)
    elif len(col_val) > 56:
        col_val_array = [col_val[i:i+56] for i in range(0, len(col_val), 56)]
        for col_val_item in col_val_array:
            if len(col_val_item) < 6:
                col_val_item = str(col_val_item).ljust(6, ' ')
            ciphertext += fpe_ff3_base(col_val_item, 10)
    else:
        ciphertext = fpe_ff3_base(col_val, 10)

    return ciphertext

def fpe_ff3_alphanumeric(col_val):

    ciphertext =""
    if len(col_val) < 6:
        col_val = str(col_val).rjust(6, '0')
        ciphertext = fpe_ff3_base(col_val, 62)
    elif len(col_val) > 32:
        col_val_array = [col_val[i:i+32] for i in range(0, len(col_val), 32)]
        for col_val_item in col_val_array:
            if len(col_val_item) < 6:
                col_val_item = str(col_val_item).ljust(6, ' ')
            ciphertext += fpe_ff3_base(col_val_item, 62)
    else:
        ciphertext = fpe_ff3_base(col_val, 62)

    return ciphertext

def fpe_ff3_alphanumeric_extended(col_val):

    extended_alphabet = string.digits + string.ascii_lowercase + string.ascii_uppercase + " !@#$%^&*()?'\/-.,"
    c = FF3Cipher.withCustomAlphabet(key, tweak, alphabet=extended_alphabet)
    ciphertext =""
    if len(col_val) < 4:
        col_val = str(col_val).rjust(4, '0')
        ciphertext = c.encrypt(col_val)
    elif len(col_val) > 30:
        col_val_array = [col_val[i:i+30] for i in range(0, len(col_val), 3)]
        for col_val_item in col_val_array:
            if len(col_val_item) < 4:
                col_val_item = str(col_val_item).ljust(4, ' ')
            ciphertext += c.encrypt(col_val_item)
    else:
        ciphertext = c.encrypt(col_val)

    return ciphertext

def fpe_ff3_phone(col_val):

    numeric_string = str(''.join(filter(str.isdigit, col_val)))
    ciphertext = fpe_ff3_base(numeric_string, 10)

    col_val_pfe = ""
    non_numeric = 0
    for j, val in enumerate(col_val):
        if not(val.isnumeric()):
            col_val_pfe += col_val[j]
            non_numeric += 1
        else:
            col_val_pfe += ciphertext[j-non_numeric]
    
    return col_val_pfe

id_fpe = fpe_ff3_numeric(id)
name = "Bremer"
name_fpe = fpe_ff3_alphanumeric(name)
company = "1"
company_fpe = fpe_ff3_alphanumeric_extended(company)
phone = "06-23112312"
phone_fpe = fpe_ff3_phone(phone)
print(id, "=>",  id_fpe)
print(name, "=>",  name_fpe)
print(company, "=>",  company_fpe)
print(phone, "=>",  phone_fpe)
